import React from "react";
import Navbar from "../../components/LandingPageComponents/Navbar";
import img1 from "../../assets/img1.png"

const HomePage = () => {
    return (
      <div>
        <div>
            <Navbar />
        </div>
        <div>
            <img src={img1} alt="" />
            <p>
                You can learn
                Anything,
                elsewhere 
            </p>
        </div>
      </div>
    )
}

export default HomePage;
